import unittest
import binascii
from TestUtils import TestParser

success = "successful"


class ParserSuite(unittest.TestCase):
    def test_simple_program(self):
        """Simple program: int main() {} """
        input = """main: function void() {}"""
        expect = "successful"
        self.assertTrue(TestParser.test(input, expect, 201))

    def test_unbalance_program_1(self):
        input = """main: function void() { a, b, c: float = 1, 2;}"""
        expect = "Error on line 1 col 45: ;"
        self.assertTrue(TestParser.test(input, expect, 202))

    def test_unbalance_program_2(self):
        input = """main: function void() { a, b, c: float = 1, 2, 3, 4;}"""
        expect = "Error on line 1 col 48: ,"
        self.assertTrue(TestParser.test(input, expect, 203))

    def test_empty_program(self):
        input = ""
        expect = "Error on line 1 col 0: <EOF>"
        self.assertTrue(TestParser.test(input, expect, 204))

    def test_invalid_program(self):
        input = "fa"
        expect = "Error on line 1 col 2: <EOF>"
        self.assertTrue(TestParser.test(input, expect, 205))

